import React from 'react'
import { TextField } from '@mui/material'
import StockCard from '../StockCard';


function StocksDisplay() {
  return (
    <div sty>
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        <StockCard/>
    </div>
  )
}

export default StocksDisplay
